#include <unordered_map>
#include <iostream>
#include <vector>
#include <string>
#include <algorithm>
using namespace std;

class Solution {
public:
    vector<int> findSubstring(string s, vector<string>& words) {
        int len;
        vector<int> ans;
        unordered_map<string, int> m;
        unordered_map<string, int> tmp;
        if (words.empty()) return ans;
        len = words[0].size();
        for (int i = 0; i < words.size(); i++) {
            if (i > 0 && words[i].length() != words[i-1].length()) return ans;
            if (m.count(words[i]) == 0) m[words[i]] = 1;
            else m[words[i]] += 1;
        }
        int i, j;
        string w;
        for (i = 0; i + words.size() * len <= s.size(); i++) {
            tmp.clear();
            for (j = i; j + len <= s.size() && j - i < words.size() * len; j += len) {
                w = s.substr(j, len);
                if (m.count(w) == 0) break;
                if (tmp.count(w) == 0) tmp[w] = 1;
                else tmp[w] += 1;
                if (tmp[w] > m[w]) break;
            }
            if (j - i == words.size() * len) {
                ans.push_back(i);
            }
        }
        return ans;
    }
};

int main() {
    Solution s;
    string str = "";

    vector<string> words;
    for (int i = 0; i < 4922; i++) {
        words.push_back("a");
    }
    auto ans = s.findSubstring(str, words);
    for (auto it = ans.begin(); it != ans.end(); it++) {
        cout << *it << endl;
    }
    return 0;
}
